import { Col, Container, Row, Form, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import logo from "../img/Blue_Futuristic_Gaming_Logo-removebg-preview.png";
import { useSelector, useDispatch } from "react-redux";
import { useState, useEffect } from "react";
import { logInData } from "../redux/actions";
import * as Icon from "react-bootstrap-icons";

const LogInPage = () => {
  const [formData, updateFormData] = useState("");

  const dispatch = useDispatch();
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [check, setCheck] = useState(false);
  const [password, setPassword] = useState("");
  const [confrmPassword, setConfirmPassword] = useState("");
  const isLoading = useSelector((state) => state.giftData.isLoading);
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState(undefined);

  const handleName = (e) => {
    setName(e.target.value);
    dispatch(logInData(loginFormData));
  };

  const handleSurname = (e) => {
    setSurname(e.target.value);
    dispatch(logInData(loginFormData));
  };
  const handlePassword = (e) => {
    setPassword(e.target.value);
    dispatch(logInData(loginFormData));
  };
  const handleEmail = (e) => {
    setEmail(e.target.value);
    dispatch(logInData(loginFormData));
  };
  const handleConfirmPassword = (e) => {
    setConfirmPassword(e.target.value);
    dispatch(logInData(loginFormData));
  };
  const handleCheck = (e) => {
    setCheck(e.target.value);
    dispatch(logInData(loginFormData));
  };

  const loginFormData = {
    name: name,
    surname: surname,
    email: email,
    phone: phone,
    password: password,
    confrmPassword: confrmPassword,
    check: check,
  };

  return (
    <Container fluid className="login-page">
      <Row className="giftcard-preview-nav py-2 ">
        <Col className="d-flex flex-column ml-5">
          <Link className="mr-auto" to={"/"}>
            <img className="logo-img " src={logo} alt="" />
          </Link>
          <span className="mr-auto textColor">LIVE EXPIRIENCE</span>
        </Col>
      </Row>
      <Row className="d-flex justify-content-center mt-4 textColor">
        <Col md={4} className=" login-content">
          <div className=" ml-3 d-flex justify-content-between align-items-center">
            <h1>Sign Up</h1>
            <Link to={"/"}>
              <Icon.XLg size={20} />
            </Link>{" "}
          </div>
          <span className="d-flex ml-3 ">
            Please fill in the form to create an account
          </span>
          <hr />
          <Form.Group className="d-flex mb-4">
            <Col>
              <Form.Control
                placeholder="First name"
                required
                // onChange={handleChange}
                onChange={handleName}
              />
            </Col>
            <Col>
              <Form.Control
                placeholder="Last name"
                required
                // onChange={handleChange}
                onChange={handleSurname}
              />
            </Col>
          </Form.Group>
          <Form.Group className="mb-4">
            <Col>
              {" "}
              <Form.Control
                type="email"
                placeholder=" Email"
                onChange={handleEmail}
              />
            </Col>
          </Form.Group>
          <Form.Group className="mb-4">
            <Col>
              <Form.Control
                type="password"
                placeholder=" Password"
                onChange={handlePassword}
              />
            </Col>
          </Form.Group>
          <Form.Group className="mb-4">
            <Col>
              <Form.Control
                type="password"
                placeholder=" Confirm Password"
                onChange={handleConfirmPassword}
              />
            </Col>
          </Form.Group>
          <span className="d-flex ml-3 mb-2">password do not match</span>
          <Form.Group className="mb-3">
            <Col>
              <div className="d-flex align-items-center">
                <Form.Check
                  className="mr-2"
                  type="checkbox"
                  onClick={handleCheck}
                />
                <span>I accept the</span>
                <Link className="mx-1"> Teams of Use</Link> &{" "}
                <Link className="ml-1">Privacy Policy</Link>
              </div>
            </Col>
          </Form.Group>
          <Col className=" d-flex mb-3">
            <Button className="px-4 sign-up-btn w-100" variant="primary">
              Sign Up
            </Button>
          </Col>
          <div className="mb-3">
            <span>
              I already have an account? <Link to={"/sign-in"}>Sign in</Link>
            </span>
          </div>
        </Col>
      </Row>
    </Container>
  );
};
export default LogInPage;
